import { NavLink } from 'react-router-dom';

const NavBar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <NavLink to="/Login">Login lol    </NavLink>
                    <NavLink to="/Home">Home lol    </NavLink>
                    <NavLink to="/Calculate">Calculate lol    </NavLink>
                    <NavLink to="/Contact">Contact lol    </NavLink>
                </li>
            </ul>
        </nav>
    )
}

export default NavBar;
